import React from 'react'
import styled from 'styled-components'

export const Modal = () => {
  return (
    <>
      <Overlay>
        <ModalContainer>
          <h1>Contenido</h1>
        </ModalContainer>
      </Overlay>
    </>
  )
}

const Overlay = styled.div`
  width: 100vw;
  height: 100vh;
  position: fixed;
  top: 0;
  left: 0;
  background: rgba(0, 0, 0, 0.5);
  display: flex;
  align-items: center;
  justify-content: center;
  padding: 4rem;
`

const ModalContainer = styled.div`
  width: 50rem;
  min-height: 10rem;
  background: #fff;
  position: relative;
  border-radius: 1rem;
  box-shadow: rgba(100, 100, 111, 0.2) 0px 7px 29px 0px;
  padding: 2rem;
`
